export * from "./budget.constants";

//Loading states
export const LOADING_STATES = {
  INITIAL: "INITIAL",
  LOADING: "LOADING",
  LOADED: "LOADED",
  FAILED: "FAILED",
};

export default {
  LOADING_STATES,
};
